      en:
        type: doc
        content:
          - type: paragraph
            content:
              - type: text
                marks:
                  - type: strong
                text: Note from TSB
          - type: paragraph
            content:
              - type: text
                marks:
                  - type: em
                text: Identification codes for international non-commercial trials
          - type: paragraph
            content:
              - type: text
                text: >-
                  Following the completion of the trial by World’s Global
                  Telecom (WGT), TSB informs of the expiration of the assignment
                  to WGT of trial numbering resources E.164.2 CC +991 with TIC
                  001 and E.212 MCC 991 with MNC 01.
          - type: paragraph
            content:
              - type: text
                text: >-
                  The assignee has duly discontinued the use of the trial
                  resources and has returned them to TSB at the end of the
                  assignment period, 15 January 2021. The returned trial
                  numbering resources E.164.2 CC +991 with TIC 001 and E.212 MCC
                  991 with MNC 01 are at disposal of the TSB Director.
